content:
--- Cho thuê nhà góc 2 mặt tiền hẻm xe hơi 69/33 đường D2(Nguyễn Gia Trí) phường 25, Quận Bình Thạnh ---



- Diện tích : 4,5 x 25 m 
- Kết cấu : 1 Trệt + 3 Lầu - Cầu thang nằm 2/3 nhà ;

- Bao gồm 3 phòng lớn mặt trước có ban công và cửa sổ lớn (40 m2) + 2 phòng nhỏ (15 m2) + sân thượng sau ;
- Mặt bằng trống suốt ;
- Khu vực sầm uất - Cung đường thương hiệu - Lợi thế góc 2 mặt tiền thoáng mát và dễ bắt mắt người đi đường thuận tiện kinh doanh mọi ngành ;

- Cho phép kinh doanh đa ngành nghề ;
- Hợp đồng thuê 3 năm / lần - Cọc 3 thanh toán 1 ;

- Giá thuê : 42.500.000 / tháng (thiện chí nhanh lẹ thương lượng thêm)

- LIÊN HỆ : 0888.104.961 để xem trong và thương lượng trực tiếp

Địa chỉ: Hẻm 104 Thành Thái, phường 10, quận 10;

Diên tích: 3.8*20m;

Kết cấu: 1 trệt 2 Lầu.
Pháp lý: sổ hồng chính chủ, giao dịch nhanh;
Giá: 7.5 tỷ thương lượng;
Vị trí thích hợp kinh doanh đa nghành nghề
****************************
Chuyên viên môi giới bất động sản trung tâm.
Liên hệ số: 0902.909.414  Mr.Sang 
Công ty CP Tư Vấn Đầu Tư Kinh Doanh Bất Động Sản Vingrand Center\
Tư vấn nhiệt tình  hỗ trợ hết mình  thông tin chính xác.

Bán nhà MT 1132 Huỳnh Tấn Phát,Q7,hầm 8 tầng.(5x35),HĐT 170tr/th.Giá 31 tỷ

- Diện tích đất công nhận: 147,9m2; tổng Dt đất: 166m2; DTXD: 147,9*8 + 147,9 

- Hầm = 1131 (m2); gác lững trong phòng: 11*25=275m2; Tổng DT sàn XD là 1400 m2; Hầm : để xe máy + kho;
 - Tầng 1: 2 phòng studio + phía trước cho thuê làm shophouse + sân trước; 
- Tầng 2: 5 phòng studio;
 - Tầng 3,4,5,6,7: mỗi tầng 5 phòng có doudled (gác) = 25 phòng có gác; 
- Tầng 8: 3 phòng studio + sân thượng trước + sân phơi đồ phía sau nhà 
* Tổng cộng: 25 phòng có gác + 10 phòng studio
 * Đầy đủ nội thất; 
* Đang có hợp đồng thuê 5 năm giá 170tr/tháng, 2 năm lên giá 7%.
Giá 31 tỷ thương lượng
Liên hệ ngay để được xem nhà chính chủ: C.Sơn 0908.56.97.94
